다시는 안사고 싶네요~ 한* , 까사*아 꺼만 썼다가 이거 시켰더니 리빙박스안이 비닐로 되있는것도 있다는걸 처음 알았네요;
한*이랑 까사*아꺼는 안에도 천으로 되어있어서 좋은데
역시나 비싼거랑 차이나네요~
그리고 제일 안좋은점은 냄새가 정말 너무나 심합니다.
머리아플정도입니다.
뚜껑 열고 베란다에 해놔도 빠지지않을것 같은 냄새라서
옷 넣어두기 참 찝찝해서 다른거 넣어놔야될것 같아요;
리빙박스에 냄새나서 베란다에 내놓기는 처음이네요ㅡㅡ
정말 추천하고싶지 않은 상품입니다.
별 0개 하고싶으나 1개부터밖에 안되서 1개 했는데 솔직히 1개도 안주고싶습니다;
